const seatsCinemaCol = ["A", "B", "C", "D", "E", "F"];
const seatsPerRow = 10;

export const seats = seatsCinemaCol.map((row) => {
  return Array.from({ length: seatsPerRow }, (_, index) => ({
    row: row,
    seatNumber: index + 1,
    seatValue: `${row}${index + 1}`,
    seatTotal: 40000,
    isAvailable: true, // Bạn có thể thay đổi trạng thái của ghế ở đây
  }));
});

